def read_xlsx():

    dataframe = openpyxl.load_workbook("Schedule.xlsx")
    
    for sheet in dataframe.sheetnames:

      classes[sheet]=[]
      sections[sheet]=[]
      dataframe1=dataframe[sheet]
      cont=False
      for row in range(0, dataframe1.max_row):
          i=0
          individual_class={}
          for col in dataframe1.iter_cols(1, dataframe1.max_column):
              val=col[row].value
              if val=="SUN":cont=True
              if not cont: continue
              if val==None: break
              if i==0: individual_class["day"]=val.strip()
              elif i==1: individual_class["stime"],individual_class["etime"]=val.strip().split(' - ')
              elif i==6: individual_class["code"]=val.strip()
              elif i==7: individual_class["module"]=val.strip()
              elif i==8: individual_class["teacher"]=val.strip()
              elif i==9: 
                  individual_class["sections"]=val.strip().split('+')
                  for s in val.strip().split('+'): 
                      if not s in sections[sheet]: sections[sheet].append(s)
              elif i==11: individual_class["room"]=val.strip()
              i+=1
          if individual_class!={}: classes[sheet].append(individual_class)  
      sections[sheet].sort()

      # def create calanders:
